import React from 'react';
import ListWrapper from './ListWrapper/ListWrapper';

const List = [
    {
        image: "https://source.unsplash.com/random",
        name: 'Gregory House',
        link: "https://www.facebook.com/",
    },
];

class App extends React.Component {
    state = {
        items: [...List],
    }
    render() {
        return (
            <>
                <ListWrapper 
                    items={this.state.items}
                />
            </>
        )
    }
} 

export default App;
